  return (
    <>
      <Header /> {/* Adiciona o header no topo */}
      <div className="sobre-container">
        <img
          src={sobreNosImage}
          alt="Sobre a clÃ­nica MedVida"
          className="sobre-imagem"
        />
      </div>
    </>
  );
}

export default SobreNos;
